import React, {Component} from 'react';
//import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor(){
    super();
    this.state={
      monsters:[
        {
          name:"Frankenstein",
          age:7
        },
        {
          name:"Dracula",
          age:10
        },
        {
          name:"Zombie",
          age:2
        }
      ]
    }
  }
  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map(monster =><h1>{monster.name}{monster.age}</h1>)
        }
      </div>
    );
  }
}

export default App;
